function traerMapa(con_capa){
    var realArrayCapas = [{
        'nombre': 'Colonias',
        'colorFill': 'rgba(250,242,183,0.60)',
        'colorStoker': '#e7c48c',
        'nombreCampo': 'NOMBRE',
        'capa': 'colonias_poligonos',
        'gejson': 'https://cartografia.xalapa.gob.mx/geoserver/colonias_poligonos/ows?service=WFS&version=1.0.0&request=GetFeature&typeName=colonias_poligonos%3Acolonias_poligonos&maxFeatures=5000&outputFormat=application%2Fjson&srsname=EPSG:3857'
    }, ];

    

    var latM,lonM,puntoDetectado=false;
    if(document.getElementsByName("longitud")[0].innerHTML!=""){
        lonM = document.getElementsByName("longitud")[0].innerHTML;
        puntoDetectado = true
    }
    else{
        lonM = document.getElementsByName("longitud")[0].value
        onchangenedded=true;
        if(lonM!=undefined && lonM!=""){
            puntoDetectado = true
        }
        else{
            puntoDetectado = false
        }
        
    }

    if(document.getElementsByName("latitud")[0].innerHTML!=""){
        latM = document.getElementsByName("latitud")[0].innerHTML;
        puntoDetectado = true
    }
    else{
        latM = document.getElementsByName("latitud")[0].value
        if(latM!=undefined && latM!=""){
            puntoDetectado = true
        }
        else{
            puntoDetectado = false
        }
    }

    console.log(puntoDetectado);

    if(puntoDetectado){
        var view = new ol.View({
            center: ol.proj.transform([parseFloat(lonM), parseFloat(latM)], 'EPSG:4326', 'EPSG:900913'),
            zoom: 14,
            minZoom: 12,
            extent: [-10794744.84438, 2212072.63612, -10775612.40370, 2225646.98972],
        });

        map = new ol.Map({
            target: 'map',
            layers: [
                new ol.layer.Tile({
                    title: 'OSM',
                    type: 'base',
                    visible: true,
                    source: new ol.source.OSM()
                })
            ],
            view: view
        })

        var MarkerIcon = new ol.Feature({
            geometry: new ol.geom.Point(ol.proj.fromLonLat([parseFloat(lonM),parseFloat(latM)])),
            name: 'MapLayer',
        })
    
        MarkerIcon.setStyle(new ol.style.Style({
            image: new ol.style.Icon({
                anchor: [0.5, 50],
                anchorXUnits: 'fraction',
                anchorYUnits: 'pixels',
                src: '/catax/static/images/marcador-de-p.png'
            })
        }));
    
        var MapSource = new ol.source.Vector({
            features: [
                MarkerIcon
            ]
        })
    
        var MapLayer = new ol.layer.Vector({
            source: MapSource
        });
    
        MapLayer.set('name', 'MapLayer');
        MapLayer.setZIndex(999);
        map.addLayer(MapLayer);
    }
    else{
        var view = new ol.View({
            center: ol.proj.transform([-96.923689, 19.527459], 'EPSG:4326', 'EPSG:900913'),
            zoom: 14,
            minZoom: 12,
            extent: [-10794744.84438, 2212072.63612, -10775612.40370, 2225646.98972],
        });

        map = new ol.Map({
            target: 'map',
            layers: [
                new ol.layer.Tile({
                    title: 'OSM',
                    type: 'base',
                    visible: true,
                    source: new ol.source.OSM()
                })
            ],
            view: view
        })

        var MarkerIcon = new ol.Feature({
            geometry: new ol.geom.Point(ol.proj.transform([-96.923689, 19.527459], 'EPSG:4326', 'EPSG:900913')),
            name: 'MapLayer',
        })
        MarkerIcon.setStyle(new ol.style.Style({
            image: new ol.style.Icon({
                anchor: [0.5, 50],
                anchorXUnits: 'fraction',
                anchorYUnits: 'pixels',
                src: '/catax/static/images/marcador-de-p.png'
            })
        }));
    
        var MapSource = new ol.source.Vector({
            features: [
                MarkerIcon
            ]
        })
    
        var MapLayer = new ol.layer.Vector({
            source: MapSource
        });
    
        MapLayer.set('name', 'MapLayer');
        MapLayer.setZIndex(999);
        map.addLayer(MapLayer);
    }
    

    if(con_capa){
        generateGeoJson(realArrayCapas);
    }

    
}

